function App() {
  return (
    <>
      <main>
      <header>
        <a href="#" className="logo"> My App</a>
        <nav>
          <a href="#" className="login">Login</a>
          <a href="#" className="register">Register</a>
        </nav>
        </header>
        </main>
    </>
  );
}

export default App;
